subSubSection.paragraph:
Description of 
holotype
.

Holotype
in generally good condition except for minor folds of skin on thighs, head slightly kinked toward left, constriction anterior to hindlimb insertions (from tying a previously attached specimen tag), all artefacts of preservation; tail tip removed as tissue sample for molecular analyses (
Fig. 4A
). Adult female, SVL 
61.5 mm
. Head moderately long (HL/SVL ratio 0.27), and wide (HW/HL ratio 0.64), dorsoventrally depressed (HH/HW ratio 0.57), distinct from neck; loreal region slightly inflated, interorbital area flat, canthus rostralis not prominent; snout moderately short (SE/HL ratio 0.40), almost twice as long as OD (OD/SE ratio 0.55); scales on forehead, canthus rostralis and snout homogenous, small, rounded and granular; scales on snout and canthus rostralis slightly larger than those on forehead; scales of interorbital and occipital region homogenous, granular, those in occipital region mixed with slightly larger, rounded, conical tubercles (
Fig. 5A
). Eye small (OD/ HL ratio 0.22); pupil vertical with crenulated margins; supraciliaries mucronate, decreasing in size towards posterior edge of orbit; ear opening oval, obliquely oriented, large; eye to ear distance slightly more than eye diameter. Rostral wider (
2.7 mm
) than deep (
1.4 mm
), partially divided dorsally by weakly developed rostral groove; single large supranasal on either side, separated by two small scales (internasals), which are approximately twice the size of enlarged granular scales on snout; rostral in contact with SL I, nasals, supranasals and an internasal; nostrils semicircular, laterally oriented, posterior half covered by nasal pad, each in broad contact with rostral and also surrounded by supranasal, SL I, and three or four postnasals; three or four scale rows separate orbits from supralabials; mental slightly wider (2.0 mm) than long (
1.7 mm
), triangular, two pairs of welldeveloped postmentals, inner pair longer (maximum length 
1.5 mm
) than and separating outer pair (maximum length 
0.8 mm
), separated from each other behind mental by a large gular scale which is subequal in size to outer postmental pair; inner postmentals bordered by mental, IL I, outer postmental and six gular scales; outer postmental bordered by inner postmental, IL I and IL II, and two gular scales on either side; supralabials 10 (8) on each side, bordered by a row of large, flat, slightly elongated scales (
Fig. 5C
); infralabials 9/9, IL II to IL VII bordered by one row of chinshields, largest anteriorly; interorbital scale rows across narrowest point of frontal bone approximately 30. Body moderately slender, relatively short (TrL/SVL ratio 0.47) with weak ventrolateral folds; dorsal scales heterogeneous, mostly rounded granular, intermixed with irregularly arranged small (2–4 times granule size) circular tubercles, bluntly conical and feebly keeled throughout (
Fig 4
), becoming more conical and smaller towards flanks, tubercles extend from frontal region to proximal one third of tail length; tubercles on nape smaller than those of dorsum, largest on flanks; enlarged tubercles on tail completely flat and weakly pointed and keeled; tubercles in approximately 24 irregular longitudinal rows at mid-body; 51–53 paravertebral tubercles; ventral scales much larger than dorsal scales, smooth, cycloid, imbricate to subimbricate, 37 or 38 mid-body ventral scale rows; gular scales smaller than ventrals and granular except a few rows of larger, flat and juxtaposed scales, including a single row of chinshields bordering mental, postmentals and infralabials (
Fig 5C
). Eleven pitted precloacal scales in a continuous series with 17 or 18 slightly smaller poreless scales followed by four weakly pitted femoral scales on either side; no precloacal groove. Three or four rows of enlarged scales between pitted precloacal scales and vent, as large as the largest ventrals and much larger than pitted precloacal scales. Tail original, dorsoventrally depressed, without distinct median furrow, tapering; tail tip removed for molecular analyses. Dorsal scales at base of tail granular, gradually becoming flatter, subimbricate posteriorly, increasing in size on lateral aspect, intermixed with 6–8 slightly enlarged tubercles near base of tail and reducing to two by fourth transverse row of tubercles (
Fig 4
); ventral scales larger that dorsal scales, imbricate, median row comprises irregularly enlarged subcaudals in one or two rows; two enlarged postcloacal tubercles at base of tail. Fore and hindlimbs relatively slender; forearm (FL/SVL ratio 0.15) and crus (CL/SVL ratio 0.18) relatively short; digits relatively short, strongly inflected at each joint, all bearing robust, recurved claws; subdigital lamellae widened beneath basal phalanx; basal lamellae series on Digits I-V: 4-4-4-5-3 (right manus) and 5-6-6-6-6 (right pes); apical lamellae series (intervening rows of non-lamellar granular scales between basal and distal lamellae series in parentheses) on Digits I-V: 6(3)-8(2)-10(1)-8(3)-7(3) (right manus) and 8(1)-8(3)-9(3)-9(3)-9(3) (right pes); interdigital webbing absent on manus, rudimentary between Digits I–V of pes; relative length of digits (measurements in mm in parentheses): I (3.7) <V (4.5) <II (4.6) <III (5.5) <IV (5.6) (right manus) and I (4.1) <II (5.1) <V (6.3) <III (6.4) <IV (7.5) (right pes); palmar and plantar scales smooth, rounded; scales on forelimb heterogeneous, composed of flat, rounded, smooth sub-imbricate scales, gradually increasing in size on forearm, smaller scales appear granular, no enlarged tubercles, ventral portion covered mostly with smaller and granular scales; scales on hindlimbs heterogeneous, dorsal part of thigh and shank, with larger, conical granular scales, intermixed with scattered, enlarged, slightly conical, weekly keeled tubercles, which are denser on shank than on thigh, anterior portion of thigh and ventral aspect of hindlimb with enlarged, smooth, imbricate scales, a few rows under thigh are slightly larger than those on abdomen (
Fig 4
).
